import { useEffect, useState } from 'react';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from "react-router-dom";
import Navbar from './components/Navbar';
import StationsList from './components/StationsList';
import Fecha from './components/Fecha'

function App() {

  const initialUrl = 'https://sedeaplicaciones.minetur.gob.es/ServiciosRESTCarburantes/PreciosCarburantes/EstacionesTerrestres/FiltroMunicipio/'

  return (
    <Router>
      <nav className='navbar navbar-expand-lg navbar-dark bg-dark'>
        <Link to="/" className='nav-link'>Inicio</Link>
        <Link to="/" className='nav-link'>Gasolina 95</Link>
        <Link to="/" className='nav-link'>Gasolina 98</Link>
        <Link to="/" className='nav-link'>Gasóleo</Link>
      </nav>
      <Routes>
        <Route exact path="/" element={<StationsList/>}>
          <div className='container mt-2'>
            <StationsList titulo='Gasolineras Arrecife' url={`${initialUrl}5237`}/>
            <StationsList titulo='Gasolineras San Bartolomé' url={`${initialUrl}5251`}/>
            <StationsList titulo='Gasolineras Haría' url={`${initialUrl}5243`}/>
            <StationsList titulo='Gasolineras Teguise' url={`${initialUrl}5256`}/>
            <StationsList titulo='Gasolineras Tías' url={`${initialUrl}5260`}/>
            <StationsList titulo='Gasolineras Tinajo' url={`${initialUrl}5261`}/>
            <StationsList titulo='Gasolineras Yaiza' url={`${initialUrl}5266`}/>
            <Fecha url='https://sedeaplicaciones.minetur.gob.es/ServiciosRESTCarburantes/PreciosCarburantes/EstacionesTerrestres/FiltroMunicipio/5237'/>
          </div>
        </Route>
      </Routes>
    </Router>

  );
}

export default App;
